/******************************************************************/
/* Override a default Anki styles so we can reliably stretch to the entire viewport */
html, body, #qa, #content {
  height: 100%;
  margin: 0;
  padding: 0;
}


/******************************************************************/
/* Top level vertical flex layout */
.box {
  height: 100%;
  min-height: 100%;

  /* Flex */
  display: flex;
  flex-direction: column;
}

.box .row { /* Shared row style */
  /*border: 1px dotted grey;*/
  margin: 0 0.5em;
}

.box .row.header { /* Header box, fits vertical content size */
  flex: 0 0 auto;
  margin-top: 0.5em;
}

.box .row.content { /* Content box, stretches to fill remaining vertical space */
  flex: 1 1 auto;
  margin-bottom: 0.5em;
}

.box .row.footer { /* Footer box, currently unused */
  flex: 0 1 40px;
}

/******************************************************************/
/* Flex layout for image & notes */
.hbox {
  /*border: 1px dotted blue;*/
  height: 100%;

  /* Flex */
  display: flex;
  flex-flow: row wrap;
  justify-content: center;
  align-content: space-evenly;
}

.hitem {
  /*border: 1px dotted red;*/
  margin: 0.4em 0.5em;
}

.hbox .hitem1{
  align-self: center;
  flex: 1 1 15em;
  display: flex;
  justify-content: center;
}

.hbox .hitem2{
  align-self: center;
  text-align:left;
  flex: 1 1 15em;
}

/******************************************************************/
/* Field styles */
.card {
  font-size: 23px;
  text-align: left;
  color: black;
  background-color: #FFFAF0;
  font-family: yuumichou;
  text-align: center;
}

@font-face { font-family: yuumichou; src: url('_yumin.ttf'); }

.focus-field{
font-size: 45px; 
}

.expression-field{
  font-size: 35px; 
  line-height: 1.5;
}

.meaning-field{
  font-size: 25px;
}

.tags {
  font-family: yuumichou;
  font-size:16px;
  color: #585858;
}

/* Color of Focus Vocab */
b {
  color: #00aa00;
  font-weight: normal;
  text-shadow: 0px 4px 3px rgba(0,0,0,0.2),
             0px 8px 13px rgba(0,0,0,0.1),
             0px 18px 23px rgba(0,0,0,0.1);
}

hr {
    border: 0;
    height: 1px;
    background: linear-gradient(to right, transparent, #81807840, transparent);
}

#imgcontainer {
  position: relative;
  font-size: 0px;
}

#audiodiv {
  position: absolute;
  top: 10px;
  left: 10px;

  /* A highlight is needed to see the button on dark images on AnkiDroid */
  background-color: #ffffff80;
  border-radius: 50%;
  box-shadow: inset 0 0 3px #000000;
}

.night_mode #audiodiv {
  background-color: #00000080;
  border-radius: 50%;
  box-shadow: inset 0 0 3px #FFFFFF;
}


img {
  width: 640px;
  max-width: 100%;
  box-shadow: 0 10px 16px 0 rgba(0,0,0,0.2),0 6px 20px 0 rgba(0,0,0,0.19)
}

/* Override default style on Migaku Editor divs */
.editableField {
  display: block;
}


